import React from 'react';

function Home() {
    return (
        <div>
            <h1>Welcome to My Blog Platform</h1>
            <p>
                Explore our latest articles and stay updated with the most recent trends in technology, design, and more.
            </p>
            <p>
                Join our community and share your thoughts by commenting on your favorite articles.
            </p>
        </div>
    );
}

export default Home;
